	 (36008,NULL,'APP',NULL,NULL,NULL,'N',3,'Y',NULL,NULL,8,11,'DATAFIX2006-06-07',TIMESTAMP'2006-06-08 11:53:59',NULL,TIMESTAMP'2004-06-02 11:21:26',TIMESTAMP'2004-01-09 00:00:00',NULL,'(ALL713) ; ALL SPECIES - MITD will be 2.0m with the following exceptions:  MITD will be 1.0m within 20m of the road centre line in areas of poor plantability associated with harvest activities.  The MITD can be reduced to 1.5m for any site series where productive and plantable sites are limited by site characteristics such as large blocky colluvium, hygric or sub hydric sites.  ; Site Series 01s.  YC based on trials near Port McNeill, limit YC leading stands to <10% of stands on this EA.  HW productivity is limited and should not exceed 20% of target stocking unless under a fertilization regime with multiple treatments, in which case HW may be preferred and S1ha standards apply.  ',NULL,'RESULTS_CNV',TIMESTAMP'2004-06-02 11:21:26','DATAFIX2006-06-07',TIMESTAMP'2006-06-08 11:53:59',3),
